import React from 'react';
import { Container, Tabs, Tab } from '@material-ui/core';

export class Home extends React.Component {
  render() {
    return (
      <Container>
        <Tabs
          indicatorColor="primary"
          textColor="primary"
        >
          <Tab label="Active" />
          <Tab label="Disabled" />
          <Tab label="Active" />
        </Tabs>
      </Container>
    );
  }
}
